import HomeNav from "./../components/HomeNav";


function Login() {
    return (
        <>
            <HomeNav />
            <div className="body">
                <div className="loginBox">
                    <span className="loginTtile">LOGIN</span>
                    <label>Email-id</label>
                    <input type="email" />
                </div>
            </div>
        </>
    );    
}

export default Login;
